tables.table_schema:
CREATE TABLE quantum_communication_datasets (
    dataset_id INT PRIMARY KEY,
    dataset_name VARCHAR(255),
    dataset_description TEXT,
    created_at TIMESTAMP
);

CREATE TABLE extracted_insights (
    insight_id INT PRIMARY KEY,
    dataset_id INT,
    insight_text TEXT,
    insight_date DATE,
    FOREIGN KEY (dataset_id) REFERENCES quantum_communication_datasets(dataset_id)
);

CREATE TABLE communication_metadata (
    id INT PRIMARY KEY,
    communication_id INT,
    metadata_key VARCHAR(50),
    metadata_value TEXT
);

CREATE TABLE data_mining_results (
    id INT PRIMARY KEY,
    result_id INT,
    result_description TEXT,
    confidence_level FLOAT
);

CREATE TABLE quantum_communication_datasets (
    dataset_id INT PRIMARY KEY,
    dataset_name VARCHAR(255),
    communication_type VARCHAR(50),
    quantum_state TEXT
);

CREATE TABLE data_scientists (
    scientist_id INT PRIMARY KEY,
    scientist_name VARCHAR(100),
    expertise_area VARCHAR(100),
    joined_date DATE
);

CREATE TABLE quantum_communication_datasets (
    dataset_id INT PRIMARY KEY,
    dataset_name TEXT,
    communication_type TEXT,
    data_size INT
);

CREATE TABLE data_mining_results (
    result_id INT PRIMARY KEY,
    dataset_id INT,
    mining_date DATE,
    mined_insights TEXT
);

CREATE TABLE communication_channels (
    channel_id INT PRIMARY KEY,
    communication_id INT,
    channel_type TEXT,
    channel_status TEXT
);

CREATE TABLE extracted_insights (
    insight_id INT PRIMARY KEY,
    result_id INT,
    insight_text TEXT,
    relevance_score FLOAT
);
